import * as React from "react";
import { Routes, Route, Link} from "react-router";
import "./App.css";
import Portfolio from "./views/portfolio";
let scroll = 0;
let wheel = 0;
let scrollingDirection = 0; //idle
function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="" element={<Portfolio />} />
      </Routes>
    </div>
  );
}
export default App();
